// This is a simple interface which specifies echo.Route addition functions which
// are present on both echo.Echo and echo.Group, since we want to allow using
// either of them for path registration
type EchoRouter interface {
	CONNECT(path string, h echo.HandlerFunc, m ...echo.MiddlewareFunc) *echo.Route
	DELETE(path string, h echo.HandlerFunc, m ...echo.MiddlewareFunc) *echo.Route
	GET(path string, h echo.HandlerFunc, m ...echo.MiddlewareFunc) *echo.Route
	HEAD(path string, h echo.HandlerFunc, m ...echo.MiddlewareFunc) *echo.Route
	OPTIONS(path string, h echo.HandlerFunc, m ...echo.MiddlewareFunc) *echo.Route
	PATCH(path string, h echo.HandlerFunc, m ...echo.MiddlewareFunc) *echo.Route
	POST(path string, h echo.HandlerFunc, m ...echo.MiddlewareFunc) *echo.Route
	PUT(path string, h echo.HandlerFunc, m ...echo.MiddlewareFunc) *echo.Route
	TRACE(path string, h echo.HandlerFunc, m ...echo.MiddlewareFunc) *echo.Route
}

// RegisterHandlers adds each server route to the EchoRouter.
func RegisterHandlers(router EchoRouter, si ServerInterface) {
	RegisterHandlersWithBaseURL(router, si, "")
}

// Registers handlers, and prepends BaseURL to the paths, so that the paths
// can be served under a prefix.
func RegisterHandlersWithBaseURL(router EchoRouter, si ServerInterface, baseURL string) {

	wrapper := ServerInterfaceWrapper{
		Handler: si,
	}

	router.GET(baseURL+"/account-info", wrapper.GetAccountInfo)
	router.POST(baseURL+"/admin/ban-user", wrapper.BanUser)
	router.POST(baseURL+"/admin/create-user", wrapper.CreateUser)
	router.GET(baseURL+"/admin/get-user", wrapper.GetUser)
	router.POST(baseURL+"/admin/has-permission", wrapper.PostAdminHasPermission)
	router.POST(baseURL+"/admin/impersonate-user", wrapper.ImpersonateUser)
	router.POST(baseURL+"/admin/list-user-sessions", wrapper.ListUserSessions)
	router.GET(baseURL+"/admin/list-users", wrapper.ListUsers)
	router.POST(baseURL+"/admin/remove-user", wrapper.RemoveUser)
	router.POST(baseURL+"/admin/revoke-user-session", wrapper.RevokeUserSession)
	router.POST(baseURL+"/admin/revoke-user-sessions", wrapper.RevokeUserSessions)
	router.POST(baseURL+"/admin/set-role", wrapper.SetUserRole)
	router.POST(baseURL+"/admin/set-user-password", wrapper.SetUserPassword)
	router.POST(baseURL+"/admin/stop-impersonating", wrapper.PostAdminStopImpersonating)
	router.POST(baseURL+"/admin/unban-user", wrapper.UnbanUser)
	router.POST(baseURL+"/admin/update-user", wrapper.UpdateUser)
	router.POST(baseURL+"/change-email", wrapper.ChangeEmail)
	router.POST(baseURL+"/change-password", wrapper.ChangePassword)
	router.POST(baseURL+"/delete-user", wrapper.DeleteUser)
	router.GET(baseURL+"/delete-user/callback", wrapper.GetDeleteUserCallback)
	router.GET(baseURL+"/error", wrapper.GetError)
	router.POST(baseURL+"/get-access-token", wrapper.PostGetAccessToken)
	router.GET(baseURL+"/get-session", wrapper.GetSession)
	router.POST(baseURL+"/link-social", wrapper.LinkSocialAccount)
	router.GET(baseURL+"/list-accounts", wrapper.ListUserAccounts)
	router.GET(baseURL+"/list-sessions", wrapper.ListUserSessions)
	router.GET(baseURL+"/ok", wrapper.GetOk)
	router.POST(baseURL+"/refresh-token", wrapper.PostRefreshToken)
	router.POST(baseURL+"/request-password-reset", wrapper.ForgetPassword)
	router.POST(baseURL+"/reset-password", wrapper.ResetPassword)
	router.GET(baseURL+"/reset-password/:token", wrapper.ResetPasswordCallback)
	router.POST(baseURL+"/revoke-other-sessions", wrapper.PostRevokeOtherSessions)
	router.POST(baseURL+"/revoke-session", wrapper.PostRevokeSession)
	router.POST(baseURL+"/revoke-sessions", wrapper.PostRevokeSessions)
	router.POST(baseURL+"/send-verification-email", wrapper.SendVerificationEmail)
	router.POST(baseURL+"/sign-in/email", wrapper.SignInEmail)
	router.POST(baseURL+"/sign-in/social", wrapper.SocialSignIn)
	router.POST(baseURL+"/sign-out", wrapper.SignOut)
	router.POST(baseURL+"/sign-up/email", wrapper.SignUpWithEmailAndPassword)
	router.POST(baseURL+"/unlink-account", wrapper.PostUnlinkAccount)
	router.POST(baseURL+"/update-user", wrapper.UpdateUser)
	router.GET(baseURL+"/verify-email", wrapper.GetVerifyEmail)

}

